DROP TABLE IF EXISTS `oa_order`;
CREATE TABLE `oa_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `oa_order` int(11) DEFAULT NULL,
  `proc_id` varchar(50) DEFAULT NULL,
  `type` char(1) DEFAULT NULL COMMENT '1.模板报价\r\n            2.样衣打版\r\n            3.大货生产\r\n            4.售后服务',
  `is_urgent` char(1) DEFAULT NULL COMMENT '0:加急\r\n            1:不加急,正常',
  `cus_code` varchar(20) DEFAULT NULL,
  `sales` varchar(20) DEFAULT NULL,
  `order_code` varchar(50) DEFAULT NULL,
  `style_code` varchar(50) DEFAULT NULL,
  `cloth_class` char(1) DEFAULT NULL,
  `pic_url` varchar(200) DEFAULT NULL,
  `file_url` varchar(200) DEFAULT NULL,
  `pay_type` varchar(50) DEFAULT NULL,
  `price_min` float(10,2) DEFAULT NULL,
  `price_max` float(10,2) DEFAULT NULL,
  `want_cnt` varchar(500) DEFAULT NULL,
  `memo` varchar(500) DEFAULT NULL,
  `wf_step` varchar(50) DEFAULT NULL COMMENT '流程节点的key',
  `wf_step_name` varchar(50) DEFAULT NULL,
  `wf_real_start` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '=上个节点的时间完成时间+本节点处理时长',
  `wf_plan_start` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '=到本节点为止的以前所有节点计划时长总和',
  `wf_step_duration` int(4) DEFAULT NULL,
  `begin_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `end_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `except_finish` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `time_rate` float(10,2) DEFAULT '1.00',
  `his_opt` varchar(500) DEFAULT NULL COMMENT '存入形式如:\r\n            ppc:刘厚萱;ie:杨逍;采购:郭靖\r\n            \r\n            实现为了查询权限',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

